using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace ConsoleApp1.Days
{
    class Day5
    {
        private string data = "";
        //private string data = "dabAcCaCBAcCcaDA";
        //private string data = "AcCag";

        public int Star1()
        {
            return ReactPoloymer(data).Length;
        }

        public int Star2()
        {
            var results = new Dictionary<char, string>();

            for (char c = 'A'; c <= 'Z'; c++)
            {
                var upper = c.ToString();
                var lower = upper.ToLower();
                var replaced = data.Replace(upper, string.Empty).Replace(lower, string.Empty);
                var reacted = ReactPoloymer(replaced);

                results.Add(c, reacted);
            }

            var result = results.OrderBy(x => x.Value.Count()).ToList();
            return result[0].Value.Count();
        }


        private string ReactPoloymer(string stringToReact)
        {
            var updatedString = string.Copy(stringToReact);
            var currentLetter = 0;
            //bool stillLooking = true;

            do
            {
                var letter = updatedString[currentLetter];
                var nextLetter = updatedString[currentLetter + 1];
                if (char.ToUpperInvariant(letter) == char.ToUpperInvariant(nextLetter) && letter != nextLetter)
                {
                    updatedString = updatedString.Remove(currentLetter, 2);
                    if (currentLetter != 0)
                    {
                        currentLetter--;
                    }
                    continue;
                }

                currentLetter++;

            } while (currentLetter < updatedString.Length - 1);

            return updatedString;
        }


    }
}
